    // </div>

    <BadgesPageContainer>

      <BadgeListColumn>

        <BadgeListHeaderRow>
          <BadgeListHeaderInfoColumn>
            <p>Badges based on <b>on-chain activity</b></p>
          </BadgeListHeaderInfoColumn>
          <BadgeListHeaderDropdownColumn>
            <Form.Select aria-label="Default select example">
              <option>Meta Portal</option>
            </Form.Select>
          </BadgeListHeaderDropdownColumn>
        </BadgeListHeaderRow>
        <BadgeListRow>
          <TokensList />
        </BadgeListRow>


      </BadgeListColumn>



      <AvatarColumn>

        <AvatarHeaderRow>

          <AvatarHeaderXPColumn>
            <div>XP</div>
          </AvatarHeaderXPColumn>

          <AvatarHeaderAccountSignInColumn>
              <AccountButton />
          </AvatarHeaderAccountSignInColumn>

        </AvatarHeaderRow>
        <AvatarRow>
          <ItemSelection />
        </AvatarRow>
      </AvatarColumn>

    </BadgesPageContainer>

  )
}

